import{_ as e}from"./plugin-vue_export-helper-DlAUqK2U.js";import{r as I,o as f,c as a,d as A,e as i,a as d,f as t}from"./app-1QH72W1w.js";const v={},p=A("strong",null,"测试流程",-1),m={href:"https://blog.csdn.net/qq_44614026/article/details/102576667",target:"_blank",rel:"noopener noreferrer"},E=t('<p>移动端测试可从如下方面考虑</p><blockquote><p>UI测试、功能测试、兼容性测试、性能测试、安全测试、安装运行卸载测试、中断测试、支付测试、升级更新测试</p></blockquote><h2 id="ui测试" tabindex="-1"><a class="header-anchor" href="#ui测试"><span>UI测试</span></a></h2><p>UI测试参考PC端测试及Web端测试</p><h2 id="功能测试" tabindex="-1"><a class="header-anchor" href="#功能测试"><span>功能测试</span></a></h2><p>功能测试参考PC端测试及Web端测试</p><h2 id="兼容性测试" tabindex="-1"><a class="header-anchor" href="#兼容性测试"><span>兼容性测试</span></a></h2><ul><li><p>不同网络环境下的兼容性，例如Wifi、2G、3G、4G、5G等</p></li><li><p>各种设备品牌、机型、系统版本等兼容性</p></li></ul><h2 id="性能测试" tabindex="-1"><a class="header-anchor" href="#性能测试"><span>性能测试</span></a></h2><p>性能测试分为：<code>响应能力测试</code>、<code>极限测试</code>、<code>压力测试</code></p><p><code>响应能力测试</code>: 验证各种情况下不同操作能否满足用户响应需求</p><p><code>极限测试</code>: 各种边界情况下验证App的响应能力，例如：低电量，内存满，网络信号弱等情况</p><p><code>压力测试</code>: 反复长期操作下，系统该资源的使用情况</p><h2 id="安全测试" tabindex="-1"><a class="header-anchor" href="#安全测试"><span>安全测试</span></a></h2><p>可从如下角度考虑</p><ol><li><p><code>软件权限</code>: 其中包括发送信息、拨打电话、连接网络、访问手机存储、联系人信息等</p></li><li><p><code>数据在本地的存储、传输</code>等</p></li><li><p>执行某些操作时导致的<code>输入有效性验证、授权、数据加密</code>等方面</p></li><li><p>基于各种<code>通信协议或者行业标准</code>来检查</p></li></ol><h2 id="安装运行卸载测试" tabindex="-1"><a class="header-anchor" href="#安装运行卸载测试"><span>安装运行卸载测试</span></a></h2><ol><li><p>验证app能否正确安装运行卸载，以及操作过程和操作前后对系统资源的占有情况</p></li><li><p>安装运行卸载的提示，报告等</p></li><li><p>检查安装路径，文件是否合理，组件是否正确注册等</p></li></ol><h2 id="中断测试" tabindex="-1"><a class="header-anchor" href="#中断测试"><span>中断测试</span></a></h2><p>前后台运行时来电话、短信、下载文件、听音乐等不同情况下的表现</p><img src="data:image/png;base64,"><h2 id="支付测试" tabindex="-1"><a class="header-anchor" href="#支付测试"><span>支付测试</span></a></h2><ol><li><p>支付结果的确认，数据库查询</p></li><li><p>请求报文是否加密</p></li><li><p>不同场景的支付: 如金额足够、金额不足、重复支付、无网支付、弱网支付、同账号多平台一起支付、不同支付方式的组合、密码正确/错误、支付上限等情况</p></li></ol><h2 id="升级更新测试" tabindex="-1"><a class="header-anchor" href="#升级更新测试"><span>升级更新测试</span></a></h2><p>常规测试就好</p>',25);function k(s,J){const r=I("ExternalLinkIcon");return f(),a("div",null,[A("p",null,[p,i("，相关博客："),A("a",m,[i("https://blog.csdn.net/qq_44614026/article/details/102576667"),d(r)])]),E])}const M=e(v,[["render",k],["__file","移动端测试.html.vue"]]);export{M as default};
